import react from 'react'
import './App.css';
import  Barchart  from './Barchart';
import Piechart from './Piechart';
import {getData} from './service/Fackserver'


function App() {
 let data = getData ()
  console.log(data);
  return (
    <>
        <div className="container-fluid mx-1  mx-xl-5 px-xl-5 mb-xl-5">
        <div className="row">
            <div className="col-xl-9">
                <h1 className="mb-4 p2-top-text"><strong>No Of Users Added : {data.length}</strong></h1>
            </div>
       </div>
       <div className="row mx-0">
            <div className="col-12 col-xl-5 border mb-3 px-auto py-3 rounded mx-auto mx-xl-3 ">
            <h6>Smart Analyzer</h6> 

            <Barchart/>
            </div>
            <div className="col-12 col-xl-5 border mb-3 px-3 py-3 rounded mx-auto  mx-xl-5">


                <h6>Smart Analyzer</h6>
                <Piechart/>

            </div>
        </div>

       </div>
<h1>number Of Users:{data.length}</h1>


<Barchart/>
<Piechart/>
    </>
  );
}

export default App;
